import { TestBed } from '@angular/core/testing';
import { ChatEventService } from 'src/app/services/chat-event.service';
import { ChatStatisticsByHourComponent } from './hourly-chat-history.component';
describe('ChatStatisticsByHourComponent', () => {
    let component;
    let fixture;
    // let chatServiceStub: Partial<ChatEventService>;
    let mockService;
    let fakeHourlyEvent;
    let httpClient;
    beforeEach(async () => {
        // service = new ChatEventService(null, null);
        mockService = jasmine.createSpyObj(['getChatStatisticsByHour']);
        mockService.getChatStatisticsByHour.and.returnValue({ timeStamp: 5 });
        // component = new ChatStatisticsByHourComponent(service);
        // chatServiceStub = {};
        await TestBed.configureTestingModule({
            declarations: [ChatStatisticsByHourComponent],
            providers: [{ provide: ChatEventService, useValue: mockService }]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(ChatStatisticsByHourComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
});
